[~ashutoshc] My .1 patch does not support non string column types with OpenCSVSerde. Rather it throws an error when non-string columns are used.  The change for HIVE-13709 might be to replace the below code with the ones corresponding to the field type and make the corresponding changes everywhere else affected :
{code}
    for (int i = 0; i < numCols; i++) {
      columnOIs.add(PrimitiveObjectInspectorFactory.javaStringObjectInspector);
    }
{code}

Thanks
